public void move(int[] data, int i, int j){ 
  int t = data[i]; 
  data[i] = data[j]; 
  data[j] = t; 
} 

public void sort(int[] d){ 
  int m; 
  for(int i = 0; i < d.length; i++){ 
    m = i; 
    for(int j = i + 1; j < d.length; j++){ 
      if( d[m] < d[j] ) 
        m = j; 
    } 
    move(d, m, i); 
  } 
} 

public void show(){ 
  int[] data = {6, -4, 0, 1, 6, 3}; 
  sort(data); 
  for(int i : data) 
    System.out.print( i ); 
}

